    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( col1 * col0 ) OR - col2 * col2 + col2 NOT BETWEEN cor0.col1 AND ( NULL );
  - name: tab0

outputs:
  - name: q2350.out
    data: |
      24	86	33
      35	97	1
      89	91	82
